import React from 'react';
import style from '../../articles.module.css';

const Header = (props) => {
    console.log(props)
    return(
        <div>
            <div className={style.articlePostData}>
                <div>
                    Title : {props.title}
                </div>
                <div>
                    Date : {props.date}
                </div>
                <div>
                    Author : {props.author}
                </div>
            </div>
        </div>
    )
}

export default Header;
